import React from 'react';
import {Link} from 'react-router-dom';

const Dd =()=>{
    return(
        <>
            <ul>
                <li><Link to='/'>Home</Link></li>
                <li><Link to='/a'>URL A</Link></li>
                <li><Link to='/b'>URL B</Link></li>
            </ul>
        </>
    );
};
export default Dd;
